  false,\n\t\"url\": null,\n\t\"notes\": \"Land-based reuse systems offer many advantages
  over netpens or flow-through systems. This includes reduced siting problems, better
  control of water quality, and optimization of growth rate and production. The primary
  disadvantages of reuse systems are higher energy use, carbon dioxide emissions,
  and capital costs. One of the most expensive unit processes in reuse systems is
  nitrification, the bacterial conversion of ammonia to nitrate. Typical nitrification
  systems involve pumping of the process water up 3-5 meter through a series of closed
  reactors using plastic beads or sand as the bacteria support media. A relatively
  new development is the moving bed filter, a system that uses small floating plastic
  media that are kept in circulation with mechanical mixing or diffused aeration.nn1440Qfilter(TANin-TANout)/Amedia.\",\n\t\"owner_org\":
